import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  user_profile: {
    borderRadius: 50,
    width: 60,
    height: 60,
    backgroundColor: "#CDCDCD",
    marginRight: 10,
    overflow: "hidden",

  },
});

export default styles;
